import { BrowserRouter, Routes, Route, useParams } from "react-router-dom";
import React, { useReducer, useRef } from "react";
import "./App.css";

function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <Routes>
          <Route path="/" element={<Login />} />
          <Route path="/signUp" element={<SignUp />} />
          <Route path="/communityhome" element={<CommunityHome />} />
          <Route
            path="/communityhome/:communityNumber"
            element={<Community />}
          />
          <Route path="/community_create" element={<Community_Create />} />
          <Route
            path="/challenge_Create/:communityNumber"
            element={<Challenge_create />}
          />
          <Route path="/edit_comu/:communityNumber" element={<Edit_Comu />} />
          <Route path="/Challenge/:challengeNumber" element={<Challenge />} />
          <Route path="/Edit_Ch/:challengeNumber" element={<Edit_Ch />} />
        </Routes>
      </div>
    </BrowserRouter>
  );
}

export default App;
